import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

class Navigation extends Component {
  render () {
    return (
      <div className="navbar">
     <NavLink to="/" className="navButton"> Home </NavLink>
     <NavLink to="/support" className="pmt_btn"> Online Support </NavLink>
     <NavLink to="/payments" className="pmt_btn"> Payments </NavLink>
     <NavLink to="/transfers" className="pmt_btn"> Transfers </NavLink>
     <NavLink to="/utilities" className="pmt_btn"> Utilities </NavLink>
     <NavLink to="/accounts" className="pmt_btn"> Accounts </NavLink>
      </div>
    )
  }
}

export default Navigation
